func NewStateStore(db ormtable.Schema) (StateStore, error) {
	serviceRecordTable, err := NewServiceRecordTable(db)
	if err != nil {
		return nil, err
	}

	userProfileTable, err := NewUserProfileTable(db)
	if err != nil {
		return nil, err
	}

	resourceTable, err := NewResourceTable(db)
	if err != nil {
		return nil, err
	}

	propertyTable, err := NewPropertyTable(db)
	if err != nil {
		return nil, err
	}

	baseParamsTable, err := NewBaseParamsTable(db)
	if err != nil {
		return nil, err
	}

	readParamsTable, err := NewReadParamsTable(db)
	if err != nil {
		return nil, err
	}

	writeParamsTable, err := NewWriteParamsTable(db)
	if err != nil {
		return nil, err
	}

	ownParamsTable, err := NewOwnParamsTable(db)
	if err != nil {
		return nil, err
	}

	return stateStore{
		serviceRecordTable,
		userProfileTable,
		resourceTable,
		propertyTable,
		baseParamsTable,
		readParamsTable,
		writeParamsTable,
		ownParamsTable,
	}, nil
}
